import AnimalItem from './AnimalItem';

const AnimalList = ({ animals }) => {
  if (animals.length === 0) <h3>アニマルが見つかりません</h3>;
  return (
    <ul>
      {animals.map(animal => (
        <AnimalItem key={animal} animal={animal} />
      ))}
    </ul>
  );
};

export default AnimalList;
